<template>
  <a v-if="href !== null" :href="href" target="_blank">
    <img :width="width" :src="src" style="border-radius: 50%" />
  </a>
</template>

<script lang="ts">
import { computed, defineComponent, inject, PropType, ref } from "vue";

const imgSrc = {
  plex: "data:image/png;base64,",
  imdb: "data:image/png;base64,",
  douban:
    "data:image/png;base64,",
  netease:
    "data:image/png;base64,",
  musicbrianz:
    "data:image/png;base64,",
};
export default defineComponent({
  name: "KLogoLink",
  props: {
    id: null,
    type: {
      type: String as PropType<
        "plex" | "douban" | "imdb" | "netease" | "musicbrianz"
      >,
      default: "plex",
    },
    width: {
      type: Number,
      default: 30,
    },
  },
  setup(props, { emit }) {
    const src = imgSrc[props.type];

    let href = computed(() => {
      if (props.id) {
        switch (props.type) {
          case "plex":
            let url = inject("plexUrl");
            return (
              url +
              "/web/index.html#!/server/4fee3a5dd1e7459bf6f31838aa03995a4c212a9a/details?key=%2Flibrary%2Fmetadata%2F" +
              props.id
            );
          case "douban":
            return "https://movie.douban.com/subject/" + props.id;
          case "imdb":
            return "https://www.imdb.com/title/" + props.id;
          case "netease":
            return "https://music.163.com/#/album?id=" + props.id;
          case "musicbrianz":
            return "https://musicbrainz.org/release/" + props.id;
        }
      } else {
        return null;
      }
    });

    return {
      src,
      href,
    };
  },
});
</script>

<style lang="less" scoped>
img {
  display: inline;
}
</style>
